import React, { Component } from 'react';
import Navbar from './Components/Navbar/Navbar.js'
import Router from './Components/Router.js'

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
          <Navbar/>
        </header>
            <Router/>
      </div>
    );
  }
}

export default App;
